    private function massMakeRegionalCoordinates(array $ids, array $coordantes){
        foreach ($coordantes as $coord)
        {
            $r = new Coordinate;
            $r->long = $coord[1];
            $r->lat = $coord[0];
            $r->save();
        foreach ($ids as $id)
            $r->regions()->attach($id);
        }    
        
    }

    private function massMakeConstituencyCoordinates(array $ids, array $coordantes)
    {
        foreach ($coordantes as $coord){
            $r = new Coordinate;
            $r->long = $coord[1];
            $r->lat = $coord[0];
            $r->save();

        foreach ($ids as $id)
            $r->constituencies()->attach($id);
        }
    }

